    <title>404</title>
    <style>
        *{
    padding: 0;
    margin: 0;
}
html body{
    height: 100%;
    width: 100%;
}
.container{
    position: absolute;
    left: 15%;
    right: 15%;
 
}
.container-img{
   width: 100%;
}
.container-img img{
    width: 100%;
    height: 100%;
}
.container-text{
    margin-top: 30px;
}
.container-text span{
    text-align: center;
    display: block;
    color: #75a0d8 ;
    font-size: 28px; 
    font-family: Lantinghei SC,Open Sans,Arial,Hiragino Sans GB,Microsoft YaHei,STHeiti,WenQuanYi Micro Hei,SimSun,sans-serif;
}
.container-bnt span button{
    border-radius: 8px;
  width: 168px;
  height: 64px;
  margin-left: auto;
  font-size: 26px;
  box-shadow:2px 2px 21px #75a0d8;
 
}

.container-bnt span{
   margin-top: 50px;
    position: absolute;
    left: 50%;
   transform: translateX(-50%);
   height: 64px;
   width: 375px; 
   display: inline-block;
   
}
.container-bnt span button:focus{
    outline: none;
}
.container-bnt span .bnt-one{
    text-align: left;
    background-color: #75a0d8;
    color: #ffffff;
    border: none
}
.container-bnt span .bnt-one .retpage{
    top:0px;
    position: absolute;
    height: 64px;
    line-height: 64px;
    width: 138px;
    left: 15px;
    font-size: 22px;
    font-family: Lantinghei SC,Open Sans,Arial,Hiragino Sans GB,Microsoft YaHei,STHeiti,WenQuanYi Micro Hei,SimSun,sans-serif;
}
.container-bnt span .bnt-one .timeOut{
    position: absolute;
    width: 60px;
    height: 64px;
    text-align: center;
    line-height: 64px;
    left: 133px;
   text-align: left;
    top: -50px;
    font-size: 22px;
    font-family: Lantinghei SC,Open Sans,Arial,Hiragino Sans GB,Microsoft YaHei,STHeiti,WenQuanYi Micro Hei,SimSun,sans-serif;
}
.container-bnt span .bnt-one:hover{
    box-shadow:1px 2px 21px #658BBB;
    background-color: #658BBB;
    color: #FEFEFE;
    cursor: pointer;
}
.container-bnt span .bnt-two{
    position: absolute;
    top: 0px;
    margin-left: 30px;
    color: #75a0d8;
    background-color: #ffffff;
   border-color:#75a0d8;
   font-size: 22px;
  font-family: Lantinghei SC,Open Sans,Arial,Hiragino Sans GB,Microsoft YaHei,STHeiti,WenQuanYi Micro Hei,SimSun,sans-serif;
  display: inline-block;
  line-height: 60px;
  border-radius: 8px;
  width: 168px;
  height: 60px;
  margin-left: auto;
  box-shadow:2px 2px 21px #75a0d8;
  margin-left: 30px;
  text-align: center;
  border: 2px solid;
}
.container-bnt span .bnt-two:hover{
    box-shadow:1px 2px 21px #658BBB;
    color: #658BBB;
    cursor: pointer;
    
}
